import React from 'react';
import './Signup.css';


const signIn = (props) => {
    return (
            <div> 
               
                   <form  onSubmit={props.verify}>
                    <div className="signup">
                    <p className="text">Enter Email Add. :</p>
                    <input className="inputbox" type="email" onChange={props.email} />
                    </div>
                    <div className="signup">
                    <p className="text">Enter Password :</p>
                   <input className="inputbox" type="password" pattern="(?=.*\d).{8,}" onChange={props.password} />
               </div><br/>
            <input type="submit"/>
                   </form> 
          </div>
    );
}

export default signIn;
